// Categorize leads based on AI qualification score
const score = $json["score"];
let stage;

if (score >= 70) {
  stage = "Hot Lead";
} else if (score >= 40) {
  stage = "Warm Lead";
} else {
  stage = "Cold Lead";
}

return [{ json: { ...$json, stage } }];

