// Parse AI response and structure the data
let rawOutput = items[0].json.output;

// Remove markdown code block formatting if present
rawOutput = rawOutput.replace(/```json\n?|\n?```/g, '').trim();

// Parse the JSON response
let parsed;
try {
  parsed = JSON.parse(rawOutput);
} catch (error) {
  // If parsing fails, create a default structure
  console.error('Failed to parse AI response:', error.message);
  parsed = {
    score: 50,
    priority: 'Medium',
    action_items: 'Review lead manually and assign to sales rep'
  };
}

// Merge with original lead data
const leadData = items[0].json;
const result = {
  ...leadData,
  ...parsed,
  processedAt: new Date().toISOString()
};

return [{ json: result }];

